import React from 'react';
import {Route} from "react-router-dom";
import './App.css';
import Routes from "./constants/routes";
import Categories from "./Categories/Categories/Categories";

const App = () => {
  return (
      <div className="App">
        <Route exact path={Routes.INDEX} component={Categories} />
      </div>
  );
};

export default App;
